import { Colors } from "../theme";

export const leftContactCard ={
    padding:'20px',
    background: Colors.dim_grey,
    '& h4,& h5':{
        color:Colors.secondary,
        fontWeight:600,
    },
    '& h5':{
        color:Colors.white,
        fontWeight:600,
    },
    '& > span':{
        color:Colors.light_gray,
    }

}
export const styledListButton = {
    display:'flex',
    alignItems:'center',
    '&  span':{
        color:Colors.white,
    },
    '& .MuiSvgIcon-root':{
        color:Colors.primary,
    }
}
export const styledListButton2 = {
    display:'flex',
    alignItems:'center',
    '& .MuiSvgIcon-root':{
        color:Colors.white,
        background:Colors.primary,
        padding:'15px',
        transition:'.4s'
    },
    '& .MuiSvgIcon-root:hover':{
        color:Colors.primary,
        background:Colors.white,
    }
}
